  return (
    <ul className={classes.list}>
      {/* {props.events.map((event) => (
        <PastEventAndFightItem
          key={event.id}
          id={event.id}
          name={event.name}
          fights={event.fight_set}
        />
      ))} */}
    </ul>
  );
}
export default PastEventAndFightList;
